import { useContext, useState, useEffect } from "react";
import AuthContext from "../AuthContext";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const Banner = () => {
  const slides = [
    { 
      image: "https://img.paisawapas.com/ovz3vew9pw/2022/09/21231652/Frame-2029-1.jpg", 
      text: "Mega Discounts on Latest Fashion!", 
      subtext: "Up to 70% off on top brands", 
      button: "Shop Now" 
    },
    { 
      image: "https://img.freepik.com/free-vector/hand-drawn-electronics-store-sale-banner-template_23-2151138129.jpg", 
      text: "Exclusive Deals on Electronics!", 
      subtext: "Top gadgets at unbeatable prices", 
      button: "Explore Now" 
    },
    { 
      image: "https://img.freepik.com/premium-vector/new-arrival-seasonal-shoes-sale-social-media-web-banner_620267-120.jpg?semt=ais_incoming", 
      text: "New Arrivals in Footwear!", 
      subtext: "Trendy styles, best comfort", 
      button: "Grab Yours" 
    },
  ];

  const [currentSlide, setCurrentSlide] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
    }, 3000);

    return () => clearInterval(interval);
  }, [slides.length]);

  return (
    <div className="banner">
      <div className="slider-container">
        <div
          className="slide-images"
          style={{
            transform: `translateX(-${currentSlide * 100}%)`,
            transition: "transform 1s ease-in-out",
          }}
        >
          {slides.map((slide, index) => (
            <div className="slide" key={index}>
              <img 
                src={slide.image} 
                alt={`Slide ${index + 1}`} 
                className="slide-img img-fluid" // img-fluid ensures responsiveness
                style={{ objectFit: 'cover', height: '100%', width: '100%' }} // Ensures image covers container
              />
            </div>
          ))}
        </div>
      </div>

      <div className="banner-content">
        <h1>{slides[currentSlide].text}</h1>
        <p>{slides[currentSlide].subtext}</p>
        <button className="banner-btn">{slides[currentSlide].button}</button>
      </div>
    </div>
  );
};

const Dashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div>
      {/* E-Mart Navbar - Transparent Design */}
      <nav className="navbar navbar-expand-lg navbar-light navbar-transparent shadow-lg fixed-top">
        <div className="container">
          <a className="navbar-brand fw-bold fs-3 logo" href="#">E-Mart</a>
          <button 
            className="navbar-toggler" 
            type="button" 
            data-bs-toggle="collapse" 
            data-bs-target="#navbarNav" 
            aria-controls="navbarNav" 
            aria-expanded="false" 
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
            <ul className="navbar-nav mx-auto">
              <li className="nav-item">
                <a className="nav-link active fs-5 px-3 nav-item-hover" href="#">Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Products</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Categories</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Orders</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Contact</a>
              </li>
            </ul>
            <button className="btn btn-light fw-bold btn-hover" onClick={handleLogout}>Logout</button>
          </div>
        </div>
      </nav>

      {/* Banner Section */}
      <Banner />

      {/* Page Content Below Navbar */}
      <div className="container mt-5 pt-5 text-center">
        <h1 className="fw-bold">Welcome to E-Mart Dashboard</h1>
        <p className="fs-5 text-muted">Manage your products, orders, and categories efficiently.</p>
      </div>
    </div>
  );
};

export default Dashboard;
